import { useState } from "react";
import { Box, Card, Typography, Button, Container } from "@mui/material";
import ProgressBar from "./ProgressBar";

// Preguntas con opciones asociadas a áreas vocacionales
const questions = [
  {
    question: "¿Qué actividad disfrutas más?",
    options: [
      { text: "Resolver problemas matemáticos", area: "Ingeniería" },
      { text: "Dibujar o diseñar cosas creativas", area: "Artes" },
      { text: "Debatir temas sociales y políticos", area: "Ciencias Sociales" },
      { text: "Investigar sobre el cuerpo humano", area: "Salud" }
    ]
  },
  {
    question: "Si tuvieras que elegir un proyecto, ¿cuál preferirías?",
    options: [
      { text: "Construir un robot", area: "Ingeniería" },
      { text: "Montar una obra de teatro", area: "Artes" },
      { text: "Hacer una encuesta sobre la comunidad", area: "Ciencias Sociales" },
      { text: "Diseñar una campaña de prevención médica", area: "Salud" }
    ]
  },
  {
    question: "¿Qué materia disfrutas más en la escuela?",
    options: [
      { text: "Física o Matemáticas", area: "Ingeniería" },
      { text: "Arte o Música", area: "Artes" },
      { text: "Historia o Filosofía", area: "Ciencias Sociales" },
      { text: "Biología o Química", area: "Salud" }
    ]
  },
  {
    question: "¿Cómo prefieres trabajar?",
    options: [
      { text: "Analizando datos y fórmulas", area: "Ingeniería" },
      { text: "Expresando ideas creativas", area: "Artes" },
      { text: "Colaborando con personas en discusiones", area: "Ciencias Sociales" },
      { text: "Ayudando a otros en su bienestar", area: "Salud" }
    ]
  }
];

export default function TestFlow() {
  const [current, setCurrent] = useState(0);
  const [scores, setScores] = useState({
    Ingeniería: 0,
    Artes: 0,
    "Ciencias Sociales": 0,
    Salud: 0
  });
  const [finished, setFinished] = useState(false);
  const [result, setResult] = useState(null);

  const handleAnswer = (area) => {
    setScores((prev) => ({
      ...prev,
      [area]: prev[area] + 1
    }));

    if (current < questions.length - 1) {
      setCurrent(current + 1);
    } else {
      // calcular el resultado final
      const maxArea = Object.entries(scores).reduce(
        (a, b) => (a[1] > b[1] ? a : b)
      );
      setResult(maxArea[0]);
      setFinished(true);
    }
  };

  if (finished) {
    return (
      <Container maxWidth="sm" sx={{ mt: 5 }}>
        <Card sx={{ p: 4, borderRadius: 3, boxShadow: 3, textAlign: "center" }}>
          <Typography variant="h4" color="#006400" gutterBottom>
            🎉 Resultado del Test
          </Typography>
          <Typography variant="h5" sx={{ mb: 2 }}>
            Tu perfil vocacional más fuerte es:
          </Typography>
          <Typography variant="h3" sx={{ fontWeight: "bold", color: "#2e7d32" }}>
            {result}
          </Typography>
          <Typography variant="body1" sx={{ mt: 3 }}>
            Este resultado refleja tus intereses y habilidades predominantes.
            ¡Explora más sobre carreras relacionadas con <b>{result}</b>!
          </Typography>
        </Card>
      </Container>
    );
  }

  const data = questions[current];

  return (
    <Container maxWidth="sm" sx={{ mt: 5 }}>
      <ProgressBar value={((current + 1) / questions.length) * 100} />

      <Card sx={{ p: 4, borderRadius: 3, boxShadow: 3 }}>
        <Typography variant="h6" color="#006400" gutterBottom>
          Pregunta {current + 1} de {questions.length}
        </Typography>
        <Typography variant="h5" sx={{ mb: 3 }}>
          {data.question}
        </Typography>

        {data.options.map((option, i) => (
          <Button
            key={i}
            variant="contained"
            fullWidth
            sx={{
              mb: 2,
              backgroundColor: "#90EE90",
              ":hover": { backgroundColor: "#77d677" },
              borderRadius: 2
            }}
            onClick={() => handleAnswer(option.area)}
          >
            {option.text}
          </Button>
        ))}
      </Card>
    </Container>
  );
}
